tables.table_schema:
CREATE TABLE mediation_success_rates (
  id SERIAL PRIMARY KEY,
  case_id INT,
  success_rate DECIMAL
);

CREATE TABLE case_durations (
  id SERIAL PRIMARY KEY,
  case_id INT,
  duration_minutes INT
);

CREATE TABLE mediators (
    mediator_id UUID PRIMARY KEY,
    mediator_name TEXT,
    mediator_email TEXT UNIQUE
);

CREATE TABLE cases (
    case_id UUID PRIMARY KEY,
    case_name TEXT,
    case_type TEXT
);

CREATE TABLE case_durations (
    duration_id UUID PRIMARY KEY,
    case_id UUID,
    start_time TIMESTAMP,
    end_time TIMESTAMP
);

CREATE TABLE mediation_centers (
  center_id INT PRIMARY KEY,
  center_name VARCHAR(50) NOT NULL,
  city VARCHAR(50) NOT NULL
);

CREATE TABLE mediators (
  mediator_id INT PRIMARY KEY,
  mediator_name VARCHAR(50) NOT NULL,
  center_id INT,
  FOREIGN KEY (center_id) REFERENCES mediation_centers(center_id)
);

CREATE TABLE case_parties (
  party_id INT PRIMARY KEY,
  party_name VARCHAR(50) NOT NULL,
  case_id INT,
  FOREIGN KEY (case_id) REFERENCES cases(case_id)
);
